// HasUserLogin applies the HasEdge predicate on the "user_login" edge.
func HasUserLogin() predicate.UserPreference {
	return predicate.UserPreference(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(UserLoginTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, UserLoginTable, UserLoginColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasUserLoginWith applies the HasEdge predicate on the "user_login" edge with a given conditions (other predicates).
func HasUserLoginWith(preds ...predicate.UserLogin) predicate.UserPreference {
	return predicate.UserPreference(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(UserLoginInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, UserLoginTable, UserLoginColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.UserPreference) predicate.UserPreference {
	return predicate.UserPreference(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.UserPreference) predicate.UserPreference {
	return predicate.UserPreference(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.UserPreference) predicate.UserPreference {
	return predicate.UserPreference(func(s *sql.Selector) {
		p(s.Not())
	})
}
